import pro1 from "../assets/Pro1.jpg"
import pro2 from "../assets/Pro2.jpg"

const ProjectCardData = [
    {
        imgsrc: pro1,
        title: "AI Navigational Bot",
        text:"I worked on a machine learning project focused on enhancing user experience. An AI chatbot was developed to streamline navigation and information retrieval for users. We employed NLP techniques such as Tokenization, Bag of Words, and Stemming. A feed-forward neural network was built to train and process the information in the chatbot. Python and Flask were used to develop the AI bot. This project significantly improved the efficiency of information retrieval and demonstrated the potential of AI in real-world applications. Continuous feedback and iterations were made to optimize the model and enhance its accuracy and performance.",
        source: "https://github.com/Aamir10-02/AI-Navigational-Bot",
        view: "https://docs.python.org/3/reference/datamodel.html#object.__add__",
    },

    {
        imgsrc: pro2,
        title: "Flask Registration Form",
        text: "I have created a registration form using Flask, which stores data in a Google Spreadsheet. Additionally, I utilized the Google API for seamless data integration. The project involved developing a user-friendly interface and ensuring secure data handling and storage. The integration with the Google API allowed for efficient and real-time data management. This project highlights the importance of smooth data integration in web applications. It also showcases how APIs can be leveraged to enhance functionality and user experience. Extensive testing and validation were conducted to ensure data integrity and security.",
        source: "https://github.com/Aamir10-02/Spread-Form",
        view: "https://docs.python.org/3/reference/datamodel.html#object.__add__",
        
    },

];

export default ProjectCardData;
